 $primary-transition\r\n    white-space: nowrap\r\n\r\n\r\n/** Types */\r\n.btn\r\n  &--flat\r\n    background-color: transparent !important\r\n    box-shadow: none !important\r\n\r\n  &--raised\r\n    will-change: box-shadow\r\n    elevation(2)\r\n\r\n    &:active\r\n      elevation(8)\r\n\r\n  &.btn--icon\r\n    .btn__content\r\n      .icon\r\n        color: inherit\r\n\r\n  &--icon\r\n    background: transparent\r\n    box-shadow: none !important\r\n    border-radius: 50%\r\n    justify-content: center\r\n    height: $button-height\r\n    width: $button-height\r\n    min-width: 0\r\n\r\n    .btn__content\r\n      padding: 0\r\n\r\n      &:before\r\n        border-radius: 50%\r\n\r\n    &.btn--small\r\n      width: $button-small-height\r\n\r\n      .btn__content\r\n        height: $button-small-height\r\n\r\n    &.btn--large\r\n      width: $button-large-height\r\n\r\n      .btn__content\r\n        height: $button-large-height\r\n\r\n  &--floating\r\n    border-radius: 50%\r\n    min-width: 0\r\n    height: $button-floating-width\r\n    width: $button-floating-width\r\n    padding: 0\r\n    elevation(6)\r\n\r\n    &:active\r\n      elevation(12)\r\n\r\n    .btn__content\r\n      flex: 1 1 auto\r\n      margin: 0\r\n      padding: 0\r\n\r\n      .icon\r\n        color: inherit\r\n\r\n    &:after\r\n      border-radius: 50%\r\n\r\n    .icon\r\n      &:not(:only-of-type):last-of-type\r\n        opacity: 0\r\n        position: absolute\r\n        transform: rotate(-45deg)\r\n        left: calc(50% - 12px)\r\n        top: calc(50% - 12px)\r\n\r\n    &.btn--active\r\n      .icon\r\n        &:not(:only-of-type)\r\n          &:first-of-type\r\n            opacity: 0\r\n            transform: rotate(45deg)\r\n            left: 'calc(50% - %s)' % (24 / 2)\r\n            top: 'calc(50% - %s)' % (24 / 2)\r\n\r\n          &:last-of-type\r\n            opacity: 1\r\n            transform: none\r\n\r\n    .icon\r\n      height: $button-floating-icon-width\r\n      width: $button-floating-icon-width\r\n\r\n    &.btn--small\r\n      height: $button-floating-small-width\r\n      width: $button-floating-small-width\r\n\r\n      .icon\r\n        font-size: $button-floating-small-icon-width\r\n        height: $button-floating-small-icon-width\r\n        width: $button-floating-small-icon-width\r\n        \r\n      &.btn--floating .icon\r\n        left: 'calc(50% - %s)' % ($button-floating-small-icon-width / 2)\r\n        top: 'calc(50% - %s)' % ($button-floating-small-icon-width / 2)\r\n\r\n\r\n    &.btn--large\r\n      height: $button-floating-large-width\r\n      width: $button-floating-large-width\r\n\r\n      .icon\r\n        font-size: $button-floating-large-icon-width\r\n        height: $button-floating-large-icon-width\r\n        width: $button-floating-large-icon-width\r\n        \r\n      &.btn--floating .icon\r\n        left: 'calc(50% - %s)' % ($button-floating-large-icon-width / 2)\r\n        top: 'calc(50% - %s)' % ($button-floating-large-icon-width / 2)\r\n\r\n  &--reverse\r\n    .btn__content\r\n      flex-direction: row-reverse\r\n\r\n    &.btn--column\r\n      .btn__content\r\n        flex-direction: column-reverse\r\n\r\n  &--fixed, &--absolute\r\n    margin: 0\r\n\r\n  // Position must have prepended .btn\r\n  // to account for tooltip\r\n  // TODO: Remove this once tooltips are\r\n  // converted to elements\r\n  &.btn--absolute\r\n    position: absolute\r\n\r\n  &.btn--fixed\r\n    position: fixed\r\n\r\n  &--top\r\n    &:not(.btn--absolute)\r\n      top: $grid-gutters.lg\r\n\r\n    &.btn--absolute\r\n      top: -($button-floating-width / 2)\r\n\r\n      &.btn--small\r\n        top: -($button-floating-small-width / 2)\r\n\r\n      &.btn--large\r\n        top: -($button-floating-large-width / 2)\r\n\r\n  &--bottom\r\n    &:not(.btn--absolute)\r\n      bottom: $grid-gutters.lg\r\n\r\n    &.btn--absolute\r\n      bottom: -($button-floating-width / 2)\r\n\r\n      &.btn--small\r\n        bottom: -($button-floating-small-width / 2)\r\n\r\n      &.btn--large\r\n        bottom: -($button-floating-large-width / 2)\r\n\r\n  &--left\r\n    left: $grid-gutters.lg\r\n\r\n  &--right\r\n    right: $grid-gutters.lg\r\n\r\n/** Sizes */\r\n.btn\r\n  &--small\r\n    font-size: $button-small-font-size\r\n    height: $button-small-height\r\n\r\n  &--large\r\n    font-size: $button-large-font-size\r\n    height: $button-large-height\r\n\r\n\r\n/** Loader */\r\n.btn\r\n  &--loader\r\n    pointer-events: none\r\n\r\n    .btn__content\r\n      opacity: 0\r\n\r\n  &__loading\r\n    align-items: center\r\n    display: flex\r\n    height: 100%\r\n    justify-content: center\r\n    left: 0\r\n    position: absolute\r\n    top: 0\r\n    width: 100%\r\n\r\n    .icon\r\n      &--left\r\n        margin-right: 1rem\r\n        line-height: inherit\r\n\r\n      &--right\r\n        margin-left: 1rem\r\n        line-height: inherit\r\n\r\n\r\n/** Custom Buttons */\r\n.btn\r\n  &--outline\r\n    border: 1px solid currentColor\r\n    background: transparent !important\r\n    box-shadow: none\r\n\r\n    &:hover\r\n      box-shadow: none\r\n\r\n  &--block\r\n    display: flex\r\n    flex: 1\r\n    margin: $button-margin-y 0\r\n    width: 100%\r\n\r\n  &--round\r\n    border-radius: 28px\r\n\r\n    &:after\r\n      border-radius: 28px\r\n\r\n\r\n/** Button w/ directional Icon */\r\n.btn\r\n  .icon\r\n    &--right\r\n      margin-left: 16px\r\n\r\n    &--left\r\n      margin-right: 16px\r\n\r\n\r\n/** Themes */\r\n.btn\r\n  &.primary,\r\n  &.secondary,\r\n  &.success,\r\n  &.error,\r\n  &.warning,\r\n  &.info\r\n    color: $material-dark.text.primary\r\n",".card\r\n  elevation(2)\r\n  position: relative\r\n  border-radius: $card-border-radius\r\n  min-width: 0\r\n      \r\n  > *:first-child\r\n    border-top-left-radius: inherit\r\n    border-top-right-radius: inherit\r\n    \r\n  > *:last-child\r\n    border-bottom-left-radius: inherit\r\n    border-bottom-right-radius: inherit\r\n\r\n  &--raised\r\n    elevation(3)\r\n    \r\n