-flex\r\n      font-size: 16px\r\n      padding-right: 4px\r\n\r\n  .menu\r\n    display: inline\r\n\r\n  .fade-transition-leave-active\r\n    position: absolute\r\n    left: 0\r\n  \r\n  &.input-group--autocomplete.input-group--focused:not(.input-group--multiple)\r\n    .input-group__selections__comma\r\n      display: none\r\n  \r\n\r\n.input-group\r\n  &--overflow,\r\n  &--editable,\r\n  &--segmented\r\n    padding: 0\r\n\r\n    .input-group__selections,\r\n    input\r\n      height: 24px\r\n      \r\n    // Handle weird transition issue\r\n    .input-group__selections__comma\r\n      top: 0\r\n      left: 0\r\n\r\n    .input-group__input\r\n      transition: .3s $transition.swing\r\n\r\n    .input-group__input:hover\r\n      background: #fff\r\n\r\n    &.input-group--focused\r\n      .input-group__input\r\n        background: #fff\r\n        elevation(8)\r\n    \r\n    label\r\n      left: 16px !important\r\n      top: 10px !important\r\n\r\n    .input-group__details      \r\n      &:after\r\n        display: none\r\n\r\n    .input-group__input\r\n      padding: 12px 16px\r\n\r\n      &:before\r\n        content: ''\r\n        position: absolute\r\n        left: 0\r\n        width: 100%\r\n        height: 1px\r\n        top: 0\r\n        transition: .3s $transition.swing\r\n      \r\n  &--segmented .input-group__input,\r\n  &--editable .input-group__input:hover,\r\n  &.input-group--focused.input-group--editable .input-group__input\r\n    &:after\r\n      background-color: rgba(0,0,0,0.12)\r\n      content: ''\r\n      position: absolute\r\n      right: 55px\r\n      height: 48px\r\n      top: 0\r\n      width: 1px\r\n    \r\n","/** Input */\r\n.input-group.input-group--selection-controls\r\n  display: flex\r\n\r\n  .icon\r\n    cursor: pointer\r\n    position: absolute\r\n    left: 0\r\n    user-select: none\r\n    transition: .3s $transition.ease-in-out\r\n\r\n  .input-group__details:before, .input-group__details:after\r\n    display: none\r\n\r\n  .input-group__input\r\n    color: inherit\r\n    width: 100%\r\n    position: relative\r\n\r\n    // Needed for safari\r\n    .icon\r\n      align-self: center\r\n      height: 30px\r\n      margin: auto\r\n\r\n/** Label */\r\n.input-group--selection-controls label\r\n  cursor: pointer\r\n  margin-left: 32px\r\n  pointer-events: auto\r\n  position: absolute\r\n  left: 0\r\n  user-select: none\r\n  z-index: 1\r\n  pointer-events: all\r\n\r\n.input-group--selection-controls__ripple\r\n  border-radius: 50%\r\n  height: 48px\r\n  width: 48px\r\n  cursor: pointer\r\n  position: absolute\r\n  transform: translate3d(-12px, -50%, 0)\r\n  transform-origin: center center\r\n  top: 50%\r\n  left: 0\r\n\r\n  &:before\r\n    content: ''\r\n    position: absolute\r\n    width: 36px\r\n    height: 36px\r\n    background: currentColor\r\n    border-radius: 50%\r\n    left: 50%\r\n    top: 50%\r\n    transform: translate3d(-50%, -50%, 0) scale(.3)\r\n    opacity: 0\r\n    transition: $ripple-animation-transition\r\n    transform-origin: center center\r\n","/** Input Group */\r\n.input-group--slider\r\n  flex-direction: row\r\n  flex-wrap: wrap\r\n\r\n  .input-group__details:before, .input-group__details:after\r\n    display: none\r\n\r\n  .input-group__input\r\n    flex: 1 1 100%\r\n\r\n\r\n  label\r\n    + .input-group__input\r\n      margin-left: 16px\r\n      flex: 1 1 auto\r\n\r\n  &:not(.input-group--disabled).input-group--dirty\r\n    .slider__track-fill\r\n      background: $theme.primary\r\n\r\n  &.input-group--active\r\n    .slider__thumb\r\n      transform: translateY(-50%) scale(1.2)\r\n\r\n    .slider__track\r\n      transition: none\r\n\r\n    .slider__thumb-container\r\n      &--label\r\n        .slider__thumb\r\n          transform: translateY(-50%) scale(0)\r\n\r\n          &:hover\r\n            transform: translateY(-50%) scale(0)\r\n\r\n    .slider__thumb-container, .slider__track-fill\r\n      transition: none\r\n\r\n    &.input-group--ticks\r\n      .slider\r\n        &__track__container:after, &__tick\r\n          opacity: 1\r\n\r\n  &.input-group--dirty\r\n    .slider__thumb\r\n      background: $theme.primary\r\n      border-color: $theme.primary\r\n\r\n    .slider__thumb--label\r\n      background: $theme.primary\r\n\r\n  &.input-group--disabled\r\n    pointer-events: none\r\n\r\n    .slider__thumb\r\n      transform: translateY(-50%) scale(.5)\r\n      background: transparent\r\n\r\n    &.input-group--dirty\r\n      border-color: transparent\r\n\r\n  &.input-group--prepend-icon\r\n    .slider\r\n      margin-left: 40px\r\n\r\n  &.input-group--append-icon\r\n    .slider\r\n      margin-right: 40px\r\n\r\n\r\n/** Slider */\r\n.slider\r\n  cursor: default\r\n  display: flex\r\n  align-items: center\r\n  position: relative\r\n  height: 30px\r\n  flex: 1\r\n  user-select: none\r\n\r\n\r\n/** Thumb/Track/Ticks */\r\n.slider\r\n  &__track__container\r\n    position: absolute\r\n    top: 50%\r\n    transform: translateY(-50%)\r\n    height: 2px\r\n    width: 100%\r\n    overflow: hidden\r\n\r\n    &:after\r\n      content: ''\r\n      position: absolute\r\n      right: 0\r\n      top: 0\r\n      height: 2px\r\n      transition: .3s $transition.swing\r\n      width: 2px\r\n      opacity: 0\r\n\r\n  &__track, &__thumb, &__tick\r\n    position: absolute\r\n    top: 0\r\n\r\n  &__track\r\n    height: 2px\r\n    left: 0\r\n    transition: .3s $transition.swing\r\n    transform-origin: right\r\n    overflow: hidden\r\n    width: 100%\r\n\r\n    &-fill\r\n      position: absolute\r\n      left: 0\r\n      height: 2px\r\n      transform-origin: left\r\n      width: 100%\r\n      transition: .3s $transition.swing\r\n\r\n  &__ticks-container\r\n    position: absolute\r\n    left: 0\r\n    height: 2px\r\n    width: 100%\r\n\r\n  &__ticks-container\r\n    top: 50%\r\n    overflow: hidden\r\n\r\n  &__tick\r\n    transition: .3s $transition.swing\r\n    opacity: 0\r\n\r\n  &__thumb-container\r\n    position: absolute\r\n    top: 50%\r\n    transition: .3s $transition.swing\r\n\r\n  &__thumb\r\n    width: 20px\r\n    height: 20px\r\n    left: -10px\r\n    top: 50%\r\n    border-radius: 50%\r\n    background: transparent\r\n    transition: .3s $transition.swing\r\n    transform: translateY(-50%) scale(.8)\r\n    user-select: none\r\n\r\n\r\n/** Thumb Label */\r\n.slider\r\n  &__thumb--label__container\r\n    position: absolute\r\n    left: 0\r\n    top: 0\r\n    transition: .3s ease-in-out\r\n\r\n  &__thumb--label\r\n    display: flex\r\n    align-items: center\r\n    justify-content: center\r\n    font-size: 12px\r\n    color: #fff\r\n    width: 28px\r\n    height: 28px\r\n    border-radius: 50% 50% 0\r\n    position: absolute\r\n    left: -14px\r\n    top: -40px\r\n    transform: rotate(45deg)\r\n    user-select: none\r\n    transition: .3s ease-in-out\r\n\r\n    span\r\n      transform: rotate(-45deg) translateZ(0)\r\n",".small-dialog\r\n  display: block\r\n  height: 100%\r\n\r\n  &__content\r\n    background: #fff\r\n    padding: 0 24px\r\n\r\n  &__actions\r\n    text-align: right\r\n\r\n  a\r\n    display: flex\r\n    align-items: center\r\n    color: rgba($material-theme.fg-color, $material-theme.primary-text-percent)\r\n    height: 100%\r\n    text-decoration: none\r\n\r\n    > *\r\n      width: 100%\r\n\r\n  .menu__activator\r\n    height: 100%\r\n",".snack\r\n  background-color: $snackbar-background-color\r\n  position: fixed\r\n  display: flex\r\n  height: 0\r\n  pointer-events: none\r\n  visibility: visible\r\n  z-index: 1000\r\n\r\n  &--absolute\r\n    position: absolute\r\n\r\n  &--top\r\n    top: 0\r\n    left: 50%\r\n    transform: translate3d(-50%, 0, 0) translateZ(0)\r\n\r\n  &--bottom\r\n    bottom: 48px\r\n    left: 50%\r\n    transform: translate3d(-50%, 0, 0) translateZ(0)\r\n\r\n  &--left\r\n    left: 8px\r\n    right: initial\r\n    transform: none\r\n\r\n    &.snack--top\r\n      top: 8px\r\n\r\n    &.snack--bottom\r\n      bottom: 56px\r\n\r\n  &--right\r\n    left: initial\r\n    right: 8px\r\n    transform: none\r\n\r\n    &.snack--top\r\n      top: 8px\r\n\r\n    &.snack--bottom\r\n      top: initial\r\n      bottom: 56px\r\n\r\n  &__content\r\n    background-color: inherit\r\n    padding: 14px 24px\r\n    border-radius: 2px\r\n    pointer-events: auto\r\n    max-width: 568px\r\n    min-width: 288px\r\n    height: 48px\r\n    align-items: center\r\n    color: #fff\r\n    display: flex\r\n    font-size: 14px\r\n    justify-content: space-between\r\n    transition: .4s $transition.swing\r\n    position: relative !important\r\n    elevation(6)\r\n\r\n    .btn\r\n      margin: 0 0 0 48px\r\n\r\n@media $display-breakpoints.xs-only\r\n  .snack\r\n    width: 100%\r\n    left: 0\r\n    right: initial\r\n    transform: none\r\n\r\n    &--right, &--left\r\n      &.snack--top\r\n        top: 0\r\n\r\n      &.snack--bottom\r\n        bottom: 48px\r\n\r\n    &__content\r\n      border-radius: 0\r\n      max-width: 100%\r\n      width: 100%\r\n\r\n      .btn\r\n        margin: 0 0 0 24px\r\n\r\n    &--multi-line &__content\r\n      height: 80px\r\n      padding: 24px\r\n\r\n    &--bottom, &--right\r\n      &.snack--multi-line\r\n        bottom: 80px\r\n\r\n    &--vertical &__content\r\n      height: 112px\r\n      padding: 24px 24px 14px\r\n      flex-direction: column\r\n      align-items: initial\r\n\r\n      .btn\r\n        align-self: flex-end\r\n\r\n    &--bottom, &--right\r\n      &.snack--vertical\r\n        bottom: 112px\r\n",".speed-dial\r\n  position: relative\r\n\r\n  &--absolute\r\n    position: absolute\r\n    \r\n  &--fixed\r\n    position: fixed\r\n    \r\n  &--top\r\n    &:not(.speed-dial--absolute)\r\n      top: $grid-gutters.sm\r\n\r\n    &.speed-dial--absolute\r\n      top: 50%\r\n      transform: translateY(-50%)\r\n\r\n  &--bottom\r\n    &:not(.speed-dial--absolute)\r\n      bottom: $grid-gutters.sm\r\n\r\n    &.speed-dial--absolute\r\n      bottom: 50%\r\n      transform: translateY(50%)\r\n      \r\n  &--left\r\n    left: $grid-gutters.sm\r\n    \r\n  &--right\r\n    right: $grid-gutters.sm\r\n    \r\n  &--direction\r\n    &-left,\r\n    &-right\r\n      .speed-dial__list\r\n        height: 100%\r\n        top: 0\r\n    \r\n    &-top,\r\n    &-bottom\r\n      .speed-dial__list\r\n        left: 0\r\n        width: 100%\r\n\r\n    &-top\r\n      .speed-dial__list\r\n        flex-direction: column-reverse\r\n        bottom: 100%\r\n        \r\n    &-right\r\n      .speed-dial__list\r\n        flex-direction: row\r\n        left: 100%\r\n\r\n    &-bottom\r\n      .speed-dial__list\r\n        flex-direction: column\r\n        top: 100%\r\n        \r\n    &-left\r\n      .speed-dial__list\r\n        flex-direction: row-reverse\r\n        right: 100%\r\n\r\n/** Elements */\r\n.speed-dial__list\r\n  align-items: center\r\n  display: flex\r\n  justify-content: center\r\n  position: absolute\r\n\r\n  .btn\r\n    for n in (1..7)\r\n      &:nth-child({n})\r\n        transition-delay: \"%ss\" % (n * .05)\r\n  ",".stepper\r\n  overflow: hidden\r\n  position: relative\r\n  elevation(2)\r\n\r\n.stepper\r\n  &__header\r\n    align-items: stretch\r\n    display: flex\r\n    flex-wrap: wrap\r\n    justify-content: space-between\r\n    elevation(2)\r\n\r\n    .divider\r\n      align-self: center\r\n      margin: 0 -16px\r\n\r\n\r\n.stepper\r\n  &__step__step\r\n    align-items: center\r\n    border-radius: 50%\r\n    display: flex\r\n    font-size: 12px\r\n    justify-content: center\r\n    height: 24px\r\n    margin-right: 8px\r\n    width: 24px\r\n    transition: .3s $transition.fast-in-fast-out\r\n\r\n    .icon\r\n      font-size: 18px\r\n\r\n.stepper\r\n  &__step\r\n    align-items: center\r\n    display: flex\r\n    flex-direction: row\r\n    flex-wrap: wrap\r\n    padding: 24px\r\n    position: relative\r\n\r\n    &--active\r\n      .stepper__label\r\n        transition: .3s $transition.ease-in-out\r\n\r\n      .stepper__step__step\r\n        background: $theme.primary\r\n\r\n    &--editable\r\n      cursor: pointer\r\n\r\n\r\n\r\n    &--complete\r\n      .stepper__step__step\r\n        background: $theme.primary\r\n\r\n    &.stepper__step--error\r\n      color: $theme.error\r\n\r\n      .stepper__step__step\r\n        background: transparent\r\n        color: inherit\r\n\r\n        .icon\r\n          font-size: 24px\r\n          color: inherit\r\n\r\n      .stepper__label\r\n        color: inherit\r\n        text-shadow: none\r\n        font-weight: 500\r\n\r\n        small\r\n          color: $theme.error\r\n\r\n.stepper\r\n  &__label\r\n    align-items: flex-start\r\n    display: flex\r\n    flex-direction: column\r\n    text-align: left\r\n\r\n    small\r\n      font-size: 12px\r\n      font-weight: 300\r\n      text-shadow: none\r\n\r\n.stepper\r\n  &__wrapper\r\n    overflow: hidden\r\n    transition: none\r\n\r\n.stepper\r\n  &__content\r\n    top: initial\r\n    bottom: 0\r\n    padding: 16px\r\n    flex: 1\r\n    // Chrome has an issue with overflow hidden for rendering\r\n    // Originally used translateZ but this messes up fixed\r\n    // elements within the stepper\r\n    // Fix for #512 and #620\r\n    // overflow: hidden\r\n    width: 100%\r\n\r\n    .btn\r\n      margin-left: 0\r\n\r\n  &--is-booted\r\n    .stepper__content, .stepper__wrapper\r\n      transition: .4s $transition.ease-in-out\r\n\r\n.stepper\r\n  &--vertical\r\n    padding-bottom: 36px\r\n\r\n    .stepper__content\r\n      margin: -8px 0 -16px 36px\r\n      padding: 16px 60px 16px 23px\r\n      width: auto\r\n\r\n    .stepper__step\r\n      padding: 24px 24px 16px\r\n\r\n    .stepper__step__step\r\n      margin-right: 12px\r\n\r\n  &--alt-labels\r\n    .stepper__header\r\n      .divider\r\n        margin: 35px -67px 0\r\n        align-self: flex-start\r\n\r\n    .stepper__step\r\n      flex-direction: column\r\n      justify-content: flex-start\r\n      align-items: center\r\n      flex-basis: 175px\r\n\r\n      small\r\n        align-self: center\r\n\r\n    .stepper__step__step\r\n      margin-right: 0\r\n      margin-bottom: 12px\r\n\r\n@media $display-breakpoints.sm-and-down\r\n  .stepper:not(.stepper--vertical)\r\n    .stepper__label\r\n      display: none\r\n\r\n    .stepper__step__step\r\n      margin-right: 0\r\n\r\n",".subheader\r\n  height: $list-item-single-height\r\n  display: flex\r\n  align-items: center\r\n  font-size: $subheader-height-font-size\r\n  font-weight: $subheader-font-weight\r\n  padding: 0 $list-right-padding 0 $list-left-padding\r\n\r\n  &--inset\r\n    margin-left: $subheader-inset-margin\r\n",".input-group.input-group--selection-controls\r\n  z-index: 0\r\n\r\n  &.switch\r\n    min-width: 36px\r\n\r\n    .input-group--selection-controls__container\r\n      position: relative\r\n\r\n      &[class*=\"--text\"]\r\n        .input-group--selection-controls__ripple--active:after\r\n          background-color: currentColor\r\n\r\n    .input-group--selection-controls__toggle\r\n      background-color: currentColor\r\n      color: inherit\r\n      position: absolute\r\n      height: 14px\r\n      top: 50%\r\n      left: 0\r\n      width: 34px\r\n      border-radius: 8px\r\n      transform: translateY(-50%)\r\n\r\n      &.input-group--selection-controls__toggle--active\r\n        opacity: .5\r\n\r\n    .input-group--selection-controls__ripple\r\n      transform: translate3d(-15px, -24px, 0)\r\n      transition: .3s $transition.fast-in-fast-out\r\n      z-index: 1\r\n\r\n      &:after\r\n        content: ''\r\n        position: absolute\r\n        display: inline-block\r\n        cursor: pointer\r\n        width: 20px\r\n        border-radius: 50%\r\n        top: 50%\r\n        left: 50%\r\n        transform: translate3d(-50%, -50%, 0)\r\n        height: 20px\r\n        elevation(4)\r\n\r\n      &--active\r\n        transform: translate3d(2px, -24px, 0)\r\n\r\n    label\r\n      margin-left: 44px",".system-bar\r\n  align-items: center\r\n  display: flex\r\n  padding: 0 8px\r\n  font-size: $headings.body-2.size\r\n  font-weight: $headings.body-2.weight\r\n  \r\n  .icon\r\n    font-size: $headings.subheading.size\r\n\r\n  &--status\r\n    height: 24px\r\n    \r\n    .icon\r\n      margin-right: 4px\r\n  \r\n  &--window\r\n    height: 32px\r\n  \r\n    .icon\r\n      font-size: $headings.h6.size\r\n      margin-right: 8px\r\n\r\n  &--status\r\n    + .navigation-drawer\r\n      margin-top: 24px\r\n      max-height: \"calc(100vh - %s)\" % 24px\r\n\r\n  &--window\r\n    + .navigation-drawer\r\n      margin-top: 32px\r\n      max-height: \"calc(100vh - %s)\" % 32px",".table\r\n  &__overflow\r\n    width: 100%\r\n    overflow-x: auto\r\n    overflow-y: hidden\r\n\r\ntable.table\r\n  border-radius: 2px\r\n  border-collapse: collapse\r\n  border-spacing: 0\r\n  width: 100%\r\n  max-width: 100%\r\n\r\n  thead, tbody\r\n    td, th\r\n      &:not(:nth-child(1)), &:first-child\r\n        padding: 0 24px\r\n\r\n  thead\r\n    tr\r\n      height: 56px\r\n\r\n    th\r\n      font-weight: 500\r\n      font-size: 12px\r\n      transition: .3s $transition.swing\r\n      white-space: nowrap\r\n      user-select: none\r\n\r\n      &.sortable\r\n        pointer-events: auto\r\n\r\n      > div\r\n        width: 100%\r\n\r\n  tbody\r\n    tr\r\n      transition: background $primary-transition\r\n      will-change: background\r\n\r\n    td, th\r\n      height: 48px\r\n\r\n    td\r\n      font-weight: 400\r\n      font-size: 13px\r\n\r\n  .input-group--selection-controls\r\n    margin: 0\r\n\r\n    .input-group__details\r\n      display: none\r\n\r\n    &.checkbox\r\n      .icon\r\n        left: 50%\r\n        transform: translateX(-50%)\r\n\r\n      .input-group--selection-controls__ripple\r\n        left: 50%\r\n        transform: translate3d(-50%, -50%, 0)\r\n  tfoot\r\n    tr:not(:last-child)\r\n      height: 48px\r\n\r\n      &:not(:only-child)\r\n        td\r\n          padding: 0 24px\r\n\r\n    tr\r\n      height: 56px\r\n",".tabs\r\n  overflow: hidden\r\n  position: relative\r\n  width: 100%\r\n\r\n  &--grow > .tabs__bar\r\n    .tabs__li\r\n      flex: 1\r\n\r\n  &--fixed > .tabs__bar\r\n    .tabs__li\r\n      min-width: 160px\r\n      max-width: 264px\r\n      flex: 0 1 160px\r\n\r\n      @media $display-breakpoints.xs-only\r\n        min-width: 72px\r\n\r\n  &--centered > .tabs__bar\r\n    .tabs__container\r\n      justify-content: center\r\n\r\n  &--icons\r\n    .tabs__bar\r\n      height: 72px\r\n\r\n    .tabs__item\r\n      flex-direction: column\r\n\r\n  &.tabs--mobile > .tabs__bar\r\n    .icon--left, .icon--right\r\n      display: none\r\n\r\n    .tabs__wrapper\r\n      &--scrollable.tabs__wrapper--overflow\r\n        overflow: hidden !important\r\n\r\n  &:not(.tabs--grow):not(.tabs--mobile)\r\n    .tabs__item\r\n      padding: 0 24px\r\n\r\n  &:not(.tabs--centered):not(.tabs--grow):not(.tabs--mobile)\r\n    .tabs__wrapper\r\n      &--scrollable\r\n        margin: 0 60px\r\n        overflow: hidden !important\r\n\r\n  &__bar\r\n    background-color: $theme.primary\r\n    width: 100%\r\n    position: relative\r\n    height: 48px\r\n\r\n    @media $display-breakpoints.sm-and-down\r\n      padding-left: 0\r\n\r\n    .icon--left, .icon--right\r\n      position: absolute\r\n      top: 0\r\n      width: 32px\r\n      align-items: center\r\n      height: 100%\r\n      cursor: pointer\r\n      user-select: none\r\n\r\n    .icon--left\r\n      left: 28px\r\n\r\n    .icon--right\r\n      right: 28px\r\n\r\n  &__container\r\n    display: flex\r\n    height: 100%\r\n    width: 100%\r\n    position: absolute\r\n    padding: 0\r\n    top: 0\r\n    align-items: center\r\n    list-style: none\r\n    will-change: transform\r\n    transition: transform 0.6s cubic-bezier(0.86, 0, 0.07, 1)\r\n\r\n    > li:not(.tabs__slider)\r\n      height: 100%\r\n\r\n    &-left\r\n      position: absolute\r\n      left: 0\r\n      top: 0\r\n      height: 100%\r\n      width: 32px\r\n      display: flex\r\n      align-items: center\r\n\r\n  &__wrapper\r\n    position: relative\r\n    overflow-x: auto\r\n    height: inherit\r\n\r\n  &__item\r\n    align-items: center\r\n    display: flex\r\n    flex-shrink: 0\r\n    justify-content: center\r\n    height: 100%\r\n    padding: 0 12px\r\n    position: relative\r\n    text-align: center\r\n    text-decoration: none\r\n    text-transform: uppercase\r\n    text-overflow: ellipsis\r\n    white-space: nowrap\r\n\r\n    .icon\r\n      color: inherit\r\n      margin: 0 0 5px\r\n\r\n    &--disabled\r\n      pointer-events: none\r\n\r\n  &__items\r\n    position: relative\r\n    border-width: 0 1px 1px 1px\r\n    border-style: solid\r\n    border-color: rgba($material-theme.fg-color, .1)\r\n    overflow: hidden\r\n\r\n  &__content\r\n    transition: $primary-transition\r\n    width: 100%\r\n\r\n    .card\r\n      border-radius: 0 0 2px 2px\r\n\r\n  &__slider\r\n    position: absolute\r\n    bottom: 0\r\n    height: 2px\r\n    background: $theme.accent\r\n    transition: $primary-transition\r\n","/** Label */\r\n.input-group--text-field label\r\n  position: absolute\r\n  top: $input-group-text-field-label-top\r\n  left: 0\r\n\r\n/** Input */\r\n.input-group--text-field\r\n  input,\r\n  textarea\r\n    caret-color: $theme.primary\r\n    font-size: $input-font-size\r\n\r\n.input-group--text-field input\r\n  box-shadow: none\r\n  flex: 1\r\n  height: $input-height\r\n  margin: 0\r\n  min-width: 0\r\n  overflow: hidden\r\n  text-overflow: ellipsis\r\n  white-space: nowrap\r\n  \r\n  &::placeholder\r\n    transition: .3s $transition.swing\r\n\r\n  + .icon\r\n    padding: 0 6px\r\n    transition: .3s $transition.ease-in-out\r\n\r\n  &:focus\r\n    outline: none\r\n\r\n  &:disabled\r\n    pointer-events: none\r\n\r\n/** Textarea */\r\n.input-group--text-field\r\n  textarea\r\n    flex: 1 1\r\n\r\n    &:focus\r\n      outline: none\r\n\r\n.input-group--text-field.input-group--textarea\r\n  label\r\n    top: 13px\r\n\r\n  textarea\r\n    border-radius: 2px\r\n    font-size: $input-font-size\r\n    transition: .3s $transition.swing\r\n\r\n  &:not(.input-group--full-width)\r\n    label\r\n      top: 30px\r\n      left: 15px\r\n      \r\n    textarea\r\n      padding: 30px 13px 0\r\n\r\n  .input-group__details\r\n    &:before,\r\n    &:after\r\n      opacity: 0\r\n      \r\n/** Counter */\r\n.input-group--text-field\r\n  .input-group__counter\r\n    margin-left: auto\r\n\r\n    &--error\r\n      color: $theme.error !important\r\n\r\n/** Input States */\r\n.input-group--text-field\r\n  &.input-group--placeholder:not(.input-group--focused):not(.input-group--dirty)\r\n    input::placeholder\r\n      opacity: 0\r\n\r\n\r\n/** Types */\r\n.input-group--text-field\r\n  // Icons\r\n  &.input-group--prepend-icon\r\n    .input-group__prepend-icon\r\n      align-items: center\r\n      display: flex\r\n      justify-content: flex-start\r\n      min-width: 40px\r\n      transition: .3s $transition.fast-in-fast-out\r\n\r\n    .input-group__details\r\n      margin-left: auto\r\n      padding-left: 40px\r\n\r\n      &:before, &:after\r\n        margin-left: 40px\r\n        max-width: calc(100% - 40px)\r\n\r\n    label\r\n      left: 40px\r\n\r\n    input\r\n      flex: auto\r\n\r\n  &:not(.input-group--single-line)\r\n    &.input-group--focused,\r\n    &:focus\r\n      label\r\n        opacity: 1\r\n\r\n      &:not(.input-group--textarea)\r\n        label\r\n          transform: translate3d(0, -18px, 0) scale(.75)\r\n\r\n      &:not(.input-group--full-width).input-group--textarea\r\n        label\r\n          transform: translate3d(0, -8px, 0) scale(.75)\r\n\r\n  &.input-group--dirty\r\n    &:not(.input-group--textarea)\r\n      label\r\n        transform: translate3d(0, -18px, 0) scale(.75)\r\n\r\n    &:not(.input-group--full-width).input-group--textarea\r\n      label\r\n        transform: translate3d(0, -8px, 0) scale(.75)\r\n\r\n  // Single Line\r\n  &.input-group--single-line\r\n    label\r\n      transform: translate3d(0,0,0)\r\n\r\n    &.input-group--dirty\r\n      label\r\n        display: none\r\n  \r\n  //