bs__bar\r\n    .tabs__li\r\n      flex: 1\r\n\r\n  &--fixed > .tabs__bar\r\n    .tabs__li\r\n      min-width: 160px\r\n      max-width: 264px\r\n      flex: 0 1 160px\r\n\r\n      @media $display-breakpoints.xs-only\r\n        min-width: 72px\r\n\r\n  &--centered > .tabs__bar\r\n    .tabs__container\r\n      justify-content: center\r\n\r\n  &--icons\r\n    .tabs__bar\r\n      height: 72px\r\n\r\n    .tabs__item\r\n      flex-direction: column\r\n\r\n  &.tabs--mobile > .tabs__bar\r\n    .icon--left, .icon--right\r\n      display: none\r\n\r\n    .tabs__wrapper\r\n      &--scrollable.tabs__wrapper--overflow\r\n        overflow: hidden !important\r\n\r\n  &:not(.tabs--grow):not(.tabs--mobile)\r\n    .tabs__item\r\n      padding: 0 24px\r\n\r\n  &:not(.tabs--centered):not(.tabs--grow):not(.tabs--mobile)\r\n    .tabs__wrapper\r\n      &--scrollable\r\n        margin: 0 60px\r\n        overflow: hidden !important\r\n\r\n  &__bar\r\n    background-color: $theme.primary\r\n    width: 100%\r\n    position: relative\r\n    height: 48px\r\n\r\n    @media $display-breakpoints.sm-and-down\r\n      padding-left: 0\r\n\r\n    .icon--left, .icon--right\r\n      position: absolute\r\n      top: 0\r\n      width: 32px\r\n      align-items: center\r\n      height: 100%\r\n      cursor: pointer\r\n      user-select: none\r\n\r\n    .icon--left\r\n      left: 28px\r\n\r\n    .icon--right\r\n      right: 28px\r\n\r\n  &__container\r\n    display: flex\r\n    height: 100%\r\n    width: 100%\r\n    position: absolute\r\n    padding: 0\r\n    top: 0\r\n    align-items: center\r\n    list-style: none\r\n    will-change: transform\r\n    transition: transform 0.6s cubic-bezier(0.86, 0, 0.07, 1)\r\n\r\n    > li:not(.tabs__slider)\r\n      height: 100%\r\n\r\n    &-left\r\n      position: absolute\r\n      left: 0\r\n      top: 0\r\n      height: 100%\r\n      width: 32px\r\n      display: flex\r\n      align-items: center\r\n\r\n  &__wrapper\r\n    position: relative\r\n    overflow-x: auto\r\n    height: inherit\r\n\r\n  &__item\r\n    align-items: center\r\n    display: flex\r\n    flex-shrink: 0\r\n    justify-content: center\r\n    height: 100%\r\n    padding: 0 12px\r\n    position: relative\r\n    text-align: center\r\n    text-decoration: none\r\n    text-transform: uppercase\r\n    text-overflow: ellipsis\r\n    white-space: nowrap\r\n\r\n    .icon\r\n      color: inherit\r\n      margin: 0 0 5px\r\n\r\n    &--disabled\r\n      pointer-events: none\r\n\r\n  &__items\r\n    position: relative\r\n    border-width: 0 1px 1px 1px\r\n    border-style: solid\r\n    border-color: rgba($material-theme.fg-color, .1)\r\n    overflow: hidden\r\n\r\n  &__content\r\n    transition: $primary-transition\r\n    width: 100%\r\n\r\n    .card\r\n      border-radius: 0 0 2px 2px\r\n\r\n  &__slider\r\n    position: absolute\r\n    bottom: 0\r\n    height: 2px\r\n    background: $theme.accent\r\n    transition: $primary-transition\r\n","/** Label */\r\n.input-group--text-field label\r\n  position: absolute\r\n  top: $input-group-text-field-label-top\r\n  left: 0\r\n\r\n/** Input */\r\n.input-group--text-field\r\n  input,\r\n  textarea\r\n    caret-color: $theme.primary\r\n    font-size: $input-font-size\r\n\r\n.input-group--text-field input\r\n  box-shadow: none\r\n  flex: 1\r\n  height: $input-height\r\n  margin: 0\r\n  min-width: 0\r\n  overflow: hidden\r\n  text-overflow: ellipsis\r\n  white-space: nowrap\r\n  \r\n  &::placeholder\r\n    transition: .3s $transition.swing\r\n\r\n  + .icon\r\n    padding: 0 6px\r\n    transition: .3s $transition.ease-in-out\r\n\r\n  &:focus\r\n    outline: none\r\n\r\n  &:disabled\r\n    pointer-events: none\r\n\r\n/** Textarea */\r\n.input-group--text-field\r\n  textarea\r\n    flex: 1 1\r\n\r\n    &:focus\r\n      outline: none\r\n\r\n.input-group--text-field.input-group--textarea\r\n  label\r\n    top: 13px\r\n\r\n  textarea\r\n    border-radius: 2px\r\n    font-size: $input-font-size\r\n    transition: .3s $transition.swing\r\n\r\n  &:not(.input-group--full-width)\r\n    label\r\n      top: 30px\r\n      left: 15px\r\n      \r\n    textarea\r\n      padding: 30px 13px 0\r\n\r\n  .input-group__details\r\n    &:before,\r\n    &:after\r\n      opacity: 0\r\n      \r\n/** Counter */\r\n.input-group--text-field\r\n  .input-group__counter\r\n    margin-left: auto\r\n\r\n    &--error\r\n      color: $theme.error !important\r\n\r\n/** Input States */\r\n.input-group--text-field\r\n  &.input-group--placeholder:not(.input-group--focused):not(.input-group--dirty)\r\n    input::placeholder\r\n      opacity: 0\r\n\r\n\r\n/** Types */\r\n.input-group--text-field\r\n  // Icons\r\n  &.input-group--prepend-icon\r\n    .input-group__prepend-icon\r\n      align-items: center\r\n      display: flex\r\n      justify-content: flex-start\r\n      min-width: 40px\r\n      transition: .3s $transition.fast-in-fast-out\r\n\r\n    .input-group__details\r\n      margin-left: auto\r\n      padding-left: 40px\r\n\r\n      &:before, &:after\r\n        margin-left: 40px\r\n        max-width: calc(100% - 40px)\r\n\r\n    label\r\n      left: 40px\r\n\r\n    input\r\n      flex: auto\r\n\r\n  &:not(.input-group--single-line)\r\n    &.input-group--focused,\r\n    &:focus\r\n      label\r\n        opacity: 1\r\n\r\n      &:not(.input-group--textarea)\r\n        label\r\n          transform: translate3d(0, -18px, 0) scale(.75)\r\n\r\n      &:not(.input-group--full-width).input-group--textarea\r\n        label\r\n          transform: translate3d(0, -8px, 0) scale(.75)\r\n\r\n  &.input-group--dirty\r\n    &:not(.input-group--textarea)\r\n      label\r\n        transform: translate3d(0, -18px, 0) scale(.75)\r\n\r\n    &:not(.input-group--full-width).input-group--textarea\r\n      label\r\n        transform: translate3d(0, -8px, 0) scale(.75)\r\n\r\n  // Single Line\r\n  &.input-group--single-line\r\n    label\r\n      transform: translate3d(0,0,0)\r\n\r\n    &.input-group--dirty\r\n      label\r\n        display: none\r\n  \r\n  /